import React, { useEffect } from 'react'
import {connect} from 'react-redux'
import * as actions from '../actions/dCandidate'
import { Container, Grid } from '@material-ui/core'
import DCandidateForm from './DCandidateForm'


/*export default function DCandidates(props) {
  return (
    <div>from DCandidates</div>
  )
}*/

const DCandidates = (props) =>
  {
    useEffect(()=>
    {
      props.fetchAllDCandidates()
    }

    )
    return (
      <Grid container>
          <Grid item xs={6}>
            <DCandidateForm></DCandidateForm>
          </Grid>
          <Grid item xs={6}>
            <div>List of Candidates</div>
          </Grid>
      </Grid>
    )
  }

const mapStateToProps = state => (
  {
    dCandidateList : state.dCandidate.List
  }  
)

const mapActionsToProps =   {
  fetchAllDCandidates : actions.fetchall
}

export default  connect(mapStateToProps,mapActionsToProps)(DCandidates)
